import React from 'react';
import { GitHub, Linkedin, Mail } from 'lucide-react';

const teamMembers = [
  {
    name: "Mpho Ndlela",
    role: "Team Lead",
    image: "https://media.licdn.com/dms/image/v2/D4D03AQHYSGtq8VOslQ/profile-displayphoto-shrink_200_200/profile-displayphoto-shrink_200_200/0/1710094803991?e=1733356800&v=beta&t=yc0I178cFsZxg7PGS-fNzg1L8vYOyGdFfDq7lzbM7MQ",
    linkedin: "#",
    github: "#",
    email: "mpho@example.com"
  },
  {
    name: "Alec Cowan",
    role: "Developer",
    image: "https://media.licdn.com/dms/image/v2/D4E03AQGxJrhjkjg1JA/profile-displayphoto-shrink_200_200/profile-displayphoto-shrink_200_200/0/1720016768535?e=1733356800&v=beta&t=dusoMygXRnIFJBpUX6iC_BhtfEZwthberv1iuZy4e34",
    linkedin: "#",
    github: "#",
    email: "alec@example.com"
  },
  {
    name: "Lucian Young",
    role: "UI Designer",
    image: "https://media.licdn.com/dms/image/v2/D5603AQHhjtgvN6VKHQ/profile-displayphoto-shrink_200_200/profile-displayphoto-shrink_200_200/0/1713450059841?e=1733356800&v=beta&t=XdFc0nLfIDHv3YQ1OxnaxSyg4ww9I6iUdAaJ077a4J4",
    linkedin: "#",
    github: "#",
    email: "lucian@example.com"
  },
  {
    name: "Anele Siwela",
    role: "Back-End Developer",
    image: "https://media.licdn.com/dms/image/v2/D4D03AQHI_NoiU-VqJw/profile-displayphoto-shrink_400_400/profile-displayphoto-shrink_400_400/0/1705055843973?e=1733356800&v=beta&t=o0T9_Kt5R_gdkZLCkhL2X9ZbU1CyJaCY9nWqssZymWE",
    linkedin: "#",
    github: "#",
    email: "anele@example.com"
  }
];

function MemberCard({ member }) {
  return (
    <div className="bg-white p-6 rounded-lg shadow-md text-center transition-all duration-300 hover:shadow-xl hover:-translate-y-1">
      <img 
        src={member.image}
        alt={member.name} 
        className="w-32 h-32 rounded-full mx-auto mb-4 border-4 border-indigo-200"
      />
      <h2 className="text-xl font-bold mb-2">{member.name}</h2>
      <p className="text-indigo-600 mb-4">{member.role}</p>
      <div className="flex justify-center space-x-4">
        <a href={member.linkedin} className="text-gray-600 hover:text-indigo-600">
          <Linkedin size={20} />
        </a>
        <a href={member.github} className="text-gray-600 hover:text-indigo-600">
          <GitHub size={20} />
        </a>
        <a href={`mailto:${member.email}`} className="text-gray-600 hover:text-indigo-600">
          <Mail size={20} />
        </a>
      </div>
    </div>
  );
}

function HomePage() {
  return (
    <div className="flex flex-col min-h-screen bg-gradient-to-b from-indigo-100 to-white">
      <header className="bg-indigo-600 text-white py-4">
        <div className="container mx-auto px-4">
          <h1 className="text-3xl font-bold text-center">Risk Rangers</h1>
        </div>
      </header>

      <main className="flex-1 py-12">
        <div className="container mx-auto px-4 sm:px-6 lg:px-8">
          <h2 className="text-4xl font-bold text-center mb-12 text-indigo-800">Meet Our Team</h2>
          
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8">
            {teamMembers.map((member, index) => (
              <MemberCard key={index} member={member} />
            ))}
          </div>
        </div>
      </main>

      <footer className="bg-indigo-800 text-white py-6 mt-auto">
        <div className="container mx-auto px-4 text-center">
          <p className="mb-2">Done by the Risk Rangers</p>
          <p className="text-sm text-indigo-200">
            Mpho Ndlela • Alec Cowan • Lucian Young • Anele Siwela
          </p>
        </div>
      </footer>
    </div>
  );
}

export default HomePage;
